import React from 'react';


function getImage(id) {
    switch(id) {
        case 1: return img1;
        case 2: return img2;
        default: return img3;
    }
}  
export default ({ input, id, label, imgSrc}) => {
	return (
        <div><h1>label</h1></div>
	);
};
